import { AppBar, Toolbar, Typography } from '@mui/material';
import React from 'react';

function Navbar() {
    return (
        <AppBar>
            <Toolbar>
                <Typography variant="h6">
                    Live Score
                </Typography>
            </Toolbar>
        </AppBar>
    );
}

export default Navbar;
